import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
// Import Style
import { IconMap } from './styled';

const Button = ( props ) => (
  	<IconMap>
  		<FontAwesomeIcon icon="map-marker" />
  	</IconMap>
);

export default(Button);
